@TheBriefingAU I love your podcast and I listen to it every day. 
However,  please can you ask @RhiannaPatrick to stop referring to it as "The" Ukraine?
We don't say The Russia, or The Australia. It implies that it is a region, not a country.

@FRNMCF6 @RAFrenzy @IAPonomarenko @mtracey - Russia being a strategic adversary is EXACTLY why we arm Ukraine,  not for their "freedom and democracy".
-China being an economic competitor is why we changed our military posture back in 2018
- We (US gov) really don't care either. Like you said it's strategic
